import styled from 'styled-components';

const Wrapper = styled.div`
  text-align: center;
  img {
    height: auto;
    max-width: 600px
  }
`

const index = () => {
  return (
    <Wrapper>
      <p>Hi</p>
      <img src="/comingSoon.jpg" alt="AmericaUK.com is coming soon"/>
    </Wrapper>
  )
}

export default index;
